import React from 'react'
import Particles from 'react-particles-js'
import './app.css'
import 'bootstrap/dist/css/bootstrap.min.css'
import { Container, Row, Col } from 'react-bootstrap'

export default function Home(props) {

    const greeting = () => {
        const greetings = ["Hello", "Hey", "Hey there", "Greetings" ]
        const random = Math.floor(Math.random() * greetings.length)
        return greetings[random]
    }

    return (
        <div className="home" id="home">
            <Particles className="resize-fix"
            params={{
                "particles": {
                    "number": {
                        "value": 75                    },
                    "size": {
                        "value": 4,
                        "random": true
                    },
                    "color": {
                        "value":"#ffffff"
                    },
                    "line_linked": {
                        "enable": false,
                        "opacity": 1,
                        "color": "#ffffff",
                        "width": 1
                    },
                    "move": {
                        "enable": true,
                        "straight": false,
                    },
                },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": true,
                            "mode": "repulse"
                        },
                    },
                    "resize": true
                },
            }} />

            <Row className="row-height-set-100">
                <Col>

                </Col>
                <Col className="d-flex justify-content-start align-items-center p-0 m-0">
                    <span id="hello"> {greeting()} & welcome to my personal website :) </span>
                </Col>
            </Row>
        </div>
    )
}
